import React from 'react';
import { Media, Image, Col } from 'react-bootstrap';
import './style.css';
const work = (props) => {
    const {
        title,
        imageUrl,
        projectDescription,
        projectUrl,
    } = props.workDetail;
    console.log(title, imageUrl, projectDescription, projectUrl);
    return (
        <>
            <Col lg={6} className="mb-3">
                <div className="hover hover-5 text-white rounded">
                    <img
                        className="img-fluid"
                        src="https://i.ibb.co/wg01kTt/Spices.jpg"
                        alt="project"
                    ></img>
                    <div className="hover-overlay"></div>
                    <div className="hover-5-content">
                        <h4 className="hover-5-title text-uppercase text-center text-white text-bold">
                            Mustafaio
                        </h4>
                        <p className="lead porject-cption text-center text-white px-2">
                            one-page portfolio website template. used the white
                            space and the scroll effects to deliver an immersive
                            experience.
                        </p>
                        <a
                            className="project-link text-center"
                            href="https://github.com/MustafaNawzat/mustafio"
                            target="_blank"
                            rel="noreferrer noopener"
                        >
                            <i className="fas fa-external-link-alt fa-2x text-white"></i>
                        </a>
                    </div>
                </div>
            </Col>
        </>
    );
};

export default work;
